int longestValidSubstring(string word, vector<string> forbidden) {
    vector<int> ends(word.size() , -1);
    unordered_map<string, int> forbidden_word;
    for(auto it : forbidden)forbidden_word[it] = 1;
    int n = word.size();
    for(int i = 0; i<n; i++){
        string temp = "";
        for(int j = i; j<i+10 && j<n; j++){
            temp += word[j];
            if(forbidden_word.find(temp) != forbidden_word.end()) {
                ends[j] = i;
            }
        }
    }

    int i = 0, j = 0;
    int ans = INT_MIN;
    while(j < n){

        if(ends[j] != -1){
            int st = ends[j];
            if(st < i){
                ans = max(ans, j-i+1);
            }
            else{
                i = st+1;
                ans = max(ans, j-i+1);
            }
        }
        else ans = max(ans,j-i+1);
        j++;
    }
    return ans;
}

int myAtoi(string s) {
    long long res = 0; // stores our integer value
    bool neg = 0; // checks whether integer will be -ve or +ve
    bool leading = true; // true if theres leading spaces 

    int n = s.size();

    for (int i = 0; i<n; i++) {
        if (s[i] == ' ') { // checks for leading spaces
            if (leading) continue;
            else break;
        }
        else if (s[i] == '-') { // checks -ve 
            if (i+1 < n && isdigit(s[i+1])) neg = 1;
            else break; // break if next char is non-digit
        }
        else if (s[i] == '+') { // checks for +ve
            if (i+1 < n && isdigit(s[i+1])) neg = 0;
            else break; // break if next char is non-digit
        }
        else if (!isdigit(s[i])) break; // break on encoutring non-digit
        else { // storing our integer value to res
            if (res < 1e11) {
                res = res*10 + (s[i]-'0');
                if (i+1 < n && !isdigit(s[i+1])) 
                    break;// break if next char is non-digit
            }
            else break;
            leading = false; // tells that integer has been encoutered
        }
    }

    if (res > INT_MAX && neg) return INT_MIN;
    if (res > INT_MAX) return INT_MAX;

    return neg ? -1*res : res;
}

int solve(int left , int right){
    if(left == 0)return 0;
    int bit1 = log2(left);
    int bit2 = log2(right);
    if(bit1 < bit2)return 0;
    return (1<<bit1) | solve((left^(1<<bit1)) , (right^(1<<bit1))); 
}
int rangeBitwiseAnd(int left, int right) {
     return solve(left , right);
}

