    int target = 0;
    for (int i = 0; i < m; i++) {
        for (int j = 0; j < n; j++) {
            if ('a' <= grid[i][j] && grid[i][j] <= 'f') {
                target |= 1 << (grid[i][j] - 'a');
                continue;
            }

            if (grid[i][j] == '@') {
                que.emplace(pair<int, int>(i, j), 0);
                mapKey[i][j] = 1;
            }
        }
    }


    int step = 0;
    while (!que.empty()) {
        int size = que.size();
        for (int s = 0; s < size; s++) {
            int i = que.front().first.first;
            int j = que.front().first.second;
            int key = que.front().second;
            que.pop();

            if ('a' <= grid[i][j] && grid[i][j] <= 'f') {
                key |= 1 << (grid[i][j] - 'a');
                if (key == target)
                    return step;

                mapKey[i][j] |= 1l << key;
            }

            for (int d = 0; d < 4; d++) {
                int newi = i + dir[d][0];
                int newj = j + dir[d][1];

                if (!(0 <= newi && newi < m && 0 <= newj && newj < n))
                    continue;

                int val = grid[newi][newj];
                if (val == '#')
                    continue;

                if ('A' <= val && val <= 'F' && (key & (1 << (val - 'A'))) == 0)
                    continue;

                if (mapKey[newi][newj] & (1l << key))
                    continue;

                 mapKey[newi][newj] |= 1l << key;
                 que.emplace(pair<int, int>(newi, newj), key);
            }
        }
        step++;
    }
    return -1;
}

int lengthOfLIS(vector<int> nums) {
    //array to store max length subsequence till that place
    vector<int> dp(nums.size(),0);
    int maxlength = 0;//to store maxlength of subsequence
    dp[0] = 1;//length will be 1 at first index 
    for(int i = 0;i<nums.size();i++){
        int currentMaxLen = 0; //to store maxlength at till this index
        for(int j = 0;j<i;j++){
            // only check when the subsequence is increasing
            if(nums[i]>nums[j]){
                if(currentMaxLen<dp[j]){
                    currentMaxLen = dp[j]; //update currentMaxLen accordingly
                }
            }
        }
        dp[i] = currentMaxLen + 1; //set the maxLength till ith index, which will be maxlenth so far + 1
        maxlength = max(maxlength,dp[i]); //update maxlength
    }

    return maxlength;
}

int maxProfit(vector<int> prices, int fee) {
    int n = prices.size();
    if (n <= 1) return 0;
    int buy = -prices[0];
    int sell = 0;
    for (int i = 1; i < n; i++) {
        int prevBuy = buy;
        buy = max(buy, sell - prices[i]);
        sell = max(sell, prevBuy + prices[i] - fee);
    }
    return sell;
}

    int maxStarSum(vector<int> vals, vector<vector<int>> edges, int k) 
    {
        int n = vals.size();
        vector<vector<pair<int, int>>>adj(n);
        for (vector<int>edge : edges)
        {
            int startNode = edge[0], startNodeVal = vals[startNode];
            int endNode = edge[1], endNodeVal = vals[endNode];
            adj[startNode].push_back({endNodeVal, endNode});
            adj[endNode].push_back({startNodeVal, startNode});
        }
        //========================================================
        int mxSum = INT_MIN;
        for (int node = 0; node < n; node++)
        {
            sort(adj[node].begin(), adj[node].end()); //sort the neighbors based on increasing "values"
            int neighborSize = adj[node].size();
            int sum = vals[node];
            for (int i = neighborSize - 1; i >= 0 && i >= (neighborSize - k); i--) //take k neighbors [start from largest vals]
            {
                int val = adj[node][i].first;
                if (val < 0) break; //if value of neighbor is < 0, it would decrease sum so "break", 
				                     //as the neighbors left to it would also have negative values
                sum += val;
            }
            mxSum = max(mxSum, sum);
        }
        //=============================================================
        return mxSum;

    }

