    while( i >= 0 || j >= 0 ){
        int x = i >= 0 ? a[i--] - '0' : 0 ;
        int y = j >= 0 ? b[j--] - '0' : 0 ;

        int sm = x + y + carry ;
        ret.push_back( '0' + (sm % 10) ) ;
        carry = sm/10;
    }
