string smallestString(string s) {
    int temp = -1;
    int cnt = 0;
    for(int i = 0; i < s.size(); i++)
    {
        if(s[i] == 'a')
        {
            cnt++;
        }
    }
    if(cnt == s.size())
    {
        s[s.size() - 1] = 'z';
        return s;
    }
    else
    {
        for(int i = 0; i < s.size(); i++)
        {
            if(s[i] == 'a')
            {
                temp = i;
                break;
            }
        }

        if(temp == 0)
        {
            int temp1 = 1, temp2 = 1;
            for(int i = 1 ; i < s.size(); i++)
            {
                if(s[i] != 'a')
                {
                    temp1 = i;
                    break;
                }
            }
            for(int i = temp1; i < s.size(); i++)
            {
                if(s[i] == 'a')
                {
                    temp2 = i;
                    break;
                }
            }

            if(temp2 > 1)
            {
                for(int i = temp1; i < temp2; i++)
                {
                    s[i] = s[i] - 1;
                }
            }
            else if(temp2 == 1)
            {
                for(int i = temp1; i < s.size(); i++)
                {
                    s[i] = s[i] - 1;
                }
            }

            return s;
        }
        else if(temp == -1)
        {
            for(int i = 0; i < s.size(); i++)
            {
                s[i] = s[i] - 1;
            }
            return s;
        }
        else
        {
            for(int i = 0; i < temp; i++)
            {
                s[i] = s[i] - 1;
            }
            return s;
        }
    }
}

