    if (words[startIndex]==target) return 0;
    int i= startIndex-1;
    int j= startIndex+1;
    int cnt1=0; int cnt2=0;
    while (true){
        cnt1++; cnt2++;
        if ((i>=0 && words[i%n]==target) || words[(n+i)%n]==target){
            return cnt1;
        }
