int largest1BorderedSquare(vector<vector<int>> grid) {
    int r = grid.size();
    int c = grid[0].size();
    vector<vector<pair<int,int>>> dp(r, vector<pair<int,int>>(c,{0,0}));

    int mx = 0;

    for(int i=0;i<r;i++){
        for(int j=0;j<c;j++){
            if(grid[i][j]!=0){

                dp[i][j].first = i == 0 ? 1 : dp[i-1][j].first+1;
                dp[i][j].second = j == 0 ? 1 : dp[i][j-1].second+1;

                int sz = min(dp[i][j].first, dp[i][j].second);
                while(sz>mx){
                    int p = min(dp[i-sz+1][j].second,dp[i][j-sz+1].first);
                    if(p>=sz)
                        mx = max(mx,sz);
                    sz--;
                }
            }
        }
    }

    return mx*mx;
}

int solve(int left , int right){
    if(left == 0)return 0;
    int bit1 = log2(left);
    int bit2 = log2(right);
    if(bit1 < bit2)return 0;
    return (1<<bit1) | solve((left^(1<<bit1)) , (right^(1<<bit1))); 
}
int rangeBitwiseAnd(int left, int right) {
     return solve(left , right);
}

int searchInsert(vector<int> nums, int target) {
    int l=0;
    int r=nums.size()-1;
    int m;
    while(l<=r){
        m=(l+r)/2;
        if(nums[m]==target){
            return m;
        }else if(nums[m]>target){
            r=m-1;
        }
        else{
            l=m+1;
        }
    }
    return l;
}

int lengthOfLIS(vector<int> nums) {
    //array to store max length subsequence till that place
    vector<int> dp(nums.size(),0);
    int maxlength = 0;//to store maxlength of subsequence
    dp[0] = 1;//length will be 1 at first index 
    for(int i = 0;i<nums.size();i++){
        int currentMaxLen = 0; //to store maxlength at till this index
        for(int j = 0;j<i;j++){
            // only check when the subsequence is increasing
            if(nums[i]>nums[j]){
                if(currentMaxLen<dp[j]){
                    currentMaxLen = dp[j]; //update currentMaxLen accordingly
                }
            }
        }
        dp[i] = currentMaxLen + 1; //set the maxLength till ith index, which will be maxlenth so far + 1
        maxlength = max(maxlength,dp[i]); //update maxlength
    }

    return maxlength;
}

int hammingDistance(int x, int y) {
    int ans=0;
    while(x || y){
        int mask=x&1;
        int mask2=y&1;
        if(mask!=mask2){
            ans++;
        }
        x>>=1;
        y>>=1;
    }
    return ans;
}

