double average(vector<int> salary) {
    int n=salary.size(),sum=0,Min=INT_MAX,Max=INT_MIN;
    for(int i:salary){
        Max = Max < i ? i : Max ;
        Min = Min > i ? i : Min ;
        sum += i;
    }
    sum -= (Min + Max);
    return sum/(n-2.0);
}

string removeOuterParentheses(string s) {
    stack<char> st;
    string res="";
    for(int i=0;i<s.size();i++){
        if(s[i]=='(' && st.empty()){
            st.push(s[i]);
        }
        else if(s[i]=='('){
            st.push(s[i]);
            res+=s[i];
        }
        else{
            st.pop();
            if(st.size()){
                res+=s[i];
            }
        }
    }
    return res;
}
